import React from "react";
import NavBar from "./Navbar";
import { Grid, Typography } from "@mui/material";

import './login.css'

export default function Login() {
  return (
    <div>
      <NavBar />
      <Grid
        container
        columnSpacing={{ sm: 2 }}
        sx={{
          border:"2em black solid"
        }}
      >

         <Grid item 
         xs={6}
         sx={{
           padding:"5rem",
           border:"1em orange solid",
           display: "flex",
           justifyContent:"flex-start"
         }}>
           <div>
             <h1>
               HI GUY
             </h1>
           </div>

         </Grid>



      </Grid>
    </div>
  );
}
